import "core-js/modules/web.dom.iterable";
import React from 'react';
import { render } from 'enzyme';
import { EuiCardGraphic, GRAPHIC_COLORS } from './card_graphic';
describe('EuiCardGraphic', function () {
  test('is rendered', function () {
    var component = render(React.createElement(EuiCardGraphic, null));
    expect(component).toMatchSnapshot();
  });
  describe('props', function () {
    describe('colors', function () {
      GRAPHIC_COLORS.forEach(function (color) {
        it("".concat(color, " is rendered"), function () {
          var component = render(React.createElement(EuiCardGraphic, {
            color: color
          }));
          expect(component).toMatchSnapshot();
        });
      });
    });
  });
});